import {ReactComponent as GithubIcon} from '/src/assets/img/github.svg';

function Navbar(){

    return (
        <header>
        <nav>
          <div>
            <h1>DSMovie</h1>
            <a href="http://github.com/serginhobalski" target="_blank"></a>
            <div>
              <GithubIcon />
              <p>/devsuperior</p>
            </div>
          </div>
        </nav>
      </header>
    );
}

export default Navbar;
